export let rerenderEntireTree = (state) => {
  root.render(
    <React.StrictMode>
      <App  state={state} 
            addPost={addPost} 
            UpdateNewPostText={UpdateNewPostText}
            UpdateMessageText ={UpdateMessageText}
            addMessage={addMessage}/>
    </React.StrictMode>
  );
};
